import React from "react";
import AboutSection from "../components/AboutSection";
import Services from "../components/Services";
import FaqSection from "../components/FaqSection";

const AboutUs = () => {
  return (
    <div>
      <AboutSection />
      <Services />
      <FaqSection />
    </div>
  );
};

export default AboutUs;
